<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">

    <title>Document</title>
    <style>
        body{
            background-color: #222;
            display: flex;
            justify-content: center;
            flex-direction: column;
            overflow: hidden;
            padding: 0;
            margin: 0;
        }
        .offline{
            max-width: 400px;
            font-family: Verdana, Geneva, Tahoma, sans-serif;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            text-align: center;
            width: 100%;
            height: 70vh;
            font-size:2rem;
            color: white;
           
        }
        p{
            font-size: 20px;
        }
        h4{
            font-size: 26px;
        }
       
        .image{
            display: flex;
            align-items: flex-end;
            overflow: hidden;
            height: 30vh;
            width: 100vw;
            padding: 0;
            margin: 0;
        }

        @media (min-width:480px){

            body{
                display: flex;
                justify-content: center;
                align-items: center;
            }
            .offline{
                height: 30vh;
            }
            .image{
                height: 70vh;
                width: 100vw;
                transform: scale(0.7);
            }
        }
    </style>
</head>
